    <script>
        var myElementPath = document.getElementById("Path");
        var myElementSkull = document.getElementById("Skull");
        var mic;
        var bass, subBass;
        var fft;
        var filter, bassEnergy, subBassEnergy;
        function setup() {
            mic = new p5.AudioIn();
            mic.start();
            fft = new p5.FFT();
            fft.setInput(mic);
            filter = new p5.LowPass();
        }
        function draw() {

            filter.freq(320);
            var spectrum = fft.analyze();
            bassEnergy = fft.getEnergy(10, 60);
            subBassEnergy = fft.getEnergy(60, 250)
            bass = ((bassEnergy / 512) + 1)
            subBass = ((subBassEnergy / 255) + 1);
            scaleById(bass, subBass);
            changeColorOnBeat(subBass);
        }

        function scaleById(bass, subBass) {
            myElementPath.style.transform = 'scale(' + (subBass) + ' )';
            myElementPath.style.transformOrigin = 'center';
            myElementSkull.style.transform = 'scale(' + (bass) + ' )';
            myElementSkull.style.transformOrigin = 'center';
        }
        function changeColorOnBeat(subBass) {
            if (subBass < 1.05) {
                myElementPath.style.fill = "white"
            }
            else if (subBass < 1.1) {
                myElementPath.style.fill = "blue"
            }
            else if (subBass < 1.175) {
                myElementPath.style.fill = "cyan"
            }
            else if (subBass < 1.3) {
                myElementPath.style.fill = "white"
            }
            else if (subBass < 1.4) {
                myElementPath.style.fill = "magenta"
            }
            else if (subBass > 1.5) {
                myElementPath.style.fill = "red"
            }
        }
    </script>
